import React from 'react';

const Leaderboard: React.FC = () => {
    const [winners, setWinners] = React.useState<{ name: string; score: number }[]>([]);

    React.useEffect(() => {
        // Fetch the leaderboard data from an API or a local source
        const fetchWinners = async () => {
            // Placeholder for fetching logic
            const data = [
                { name: 'Alice', score: 95 },
                { name: 'Bob', score: 90 },
                { name: 'Charlie', score: 85 },
            ];
            setWinners(data);
        };

        fetchWinners();
    }, []);

    return (
        <div className="leaderboard">
            <h1>Leaderboard</h1>
            <table>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Score</th>
                    </tr>
                </thead>
                <tbody>
                    {winners.map((winner, index) => (
                        <tr key={index}>
                            <td>{winner.name}</td>
                            <td>{winner.score}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default Leaderboard;
